import React, { Component, Fragment, useEffect } from 'react'
import PropTypes from 'prop-types'

export default class MediaPlayer extends Component {
    static propTypes = {
        prop: PropTypes
    }

    render() {
        return (

            <Fragment>

                    <script src="//amp.azure.net/libs/amp/2.3.4/azuremediaplayer.min.js"></script>
                    <link href="//amp.azure.net/libs/amp/2.3.4/skins/amp-default/azuremediaplayer.min.css" rel="stylesheet" />

                    <body>

                        <h1>Example - AMP with Application Insights Plugin+ Azure Media Player</h1>

                        <video id="azuremediaplayer" className="azuremediaplayer amp-default-skin amp-big-play-centered" tabIndex={0} />

                        </body>


                        <body>


                        <footer>
                            <br />
                            <p>Â© Microsoft Corporation 2016</p>
                        </footer>

                    </body>

            </Fragment>
        )
    }
}
